import './index.css'

export default class Homepage extends Component {
  render() {
  return (
      <div className="Homepage">
        <Particles class="canvas" style={{position: "fixed", width: "100%", zIndex:"0", left:0}} params={{particles: {number: {value: 250}}}}/>
          <h1><strong>Hi, my name is Phoenix!</strong></h1>
            <bird class="" src={require('Gang.svg')}/>
